import React from 'react'
import Skeleton, { SkeletonTheme } from 'react-loading-skeleton'

import { Box } from '../styles/components/Character'

const CharacterListLoading: React.FC = () => {
  const content = [1, 2, 3, 4, 5, 6, 7, 8]

  return (
    <SkeletonTheme>
      {content.map(element => (
        <Box>
          <Skeleton count={1} duration={1} width={100} height={100} />
          <Skeleton count={1} duration={1} width={10} height={10} />
        </Box>
      ))}
    </SkeletonTheme>
  )
}

export default CharacterListLoading
